import React from 'react';
import { format } from 'date-fns';
import TimeRange from '../../components/TimelineSlider/App';
import {
  selectedInterval,
  timelineInterval,
  initialPoints,
} from './datesSource';

const Split = () => {
  const onChange = (newTime: ReadonlyArray<number>) => {
    const formattedNewTime = newTime.map((t) => new Date(t));
    if (props.onChangeCallback) {
      props.onChangeCallback([
        formattedNewTime[0],
        formattedNewTime[1],
        formattedNewTime[2],
      ]);
    }
  };

  const onUpdate = (newTime: ReadonlyArray<number>) => {
    const { onUpdateCallback } = props;

    if (!onUpdateCallback) {
      return;
    }

    const formattedNewTime = newTime.map((t) => new Date(t));
    onUpdateCallback({ error: false, time: formattedNewTime });
  };

  return (
    <div>
      <div
        style={{
          width: '80vw',
          /* height: '80vh', */
          margin: '24px auto',
          background: '#fff',
          borderRadius: '20px',
        }}
      >
        캔버스 영역
      </div>
      <div
        style={{
          padding: '16px',
          /* height: '20vh', */
          background: '#fff',
          overflowX: 'scroll',
        }}
      >
        <div className="container">
          <div className="info" style={{ fontSize: '20px' }}>
            {selectedInterval.map((d, i) => (
              <span key={d.getTime()}>{format(d, 'yyyy MM dd, HH:mm')}</span>
            ))}
          </div>

          <TimeRange
            selectedInterval={selectedInterval}
            timelineInterval={timelineInterval}
            initialPoints={initialPoints}
          />
        </div>
      </div>
    </div>
  );
};

export default Split;
